    "2016-04-19T02:28:27.121185",nt"name": "bond-ratings",nt"isopen": false,nt"url":
    null,nt"notes": "Austin Energy has consistently maintained high bond ratings.
    A bond rating is a measure of a companyu2019s credit quality, which includes the
    ability to repay its debt in a timely fashion. Austin Energy underwent a rating
    review in the fall of 2012 and received a step-up rating from one rating agency,
    while the other two rating agencies reaffirmed their prior ratings. The Council-approved
    rate increase was a key component in their u201cstableu201d outlook for Austin Energy.
    Fitch, Inc. upgraded the prior lien debt rating in FY2013 due in part to strong
    combined debt service coverage.",nt"license_title": "License Not Specified",nt"extras":
